import {
    Box,
    Typography,
    Accordion,
    AccordionSummary,
    AccordionDetails,
    Grid,
    Button,
    useTheme,
    Checkbox,
  } from "@mui/material";
  import ExpandMoreOutlinedIcon from "@mui/icons-material/ExpandMoreOutlined";
  import { tokens } from "../../theme";
  import { mockDataTeam } from "../../data/mockData";
  import Header from "../../components/Header";
  import { useState } from "react";
  import { useNavigate } from "react-router-dom";
  
  const Team = () => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);
    const [expandedId, setExpandedId] = useState(null);
    const [checkedItems, setCheckedItems] = useState({}); // State for checkboxes
    const navigate = useNavigate(); // Instantiate the navigate function
  
    // Function to navigate to Pump.jsx and pass the `member` object
    const goToPumpPage = (member) => {
      navigate("/pump", {
        state: {
          member: member, // Pass the entire `member` object
        },
      });
    };
  
    // Function to handle checkbox changes
    const handleCheckboxChange = (id) => {
      setCheckedItems((prev) => ({
        ...prev,
        [id]: !prev[id], // Toggle checked state
      }));
    };
  
    // Function to handle navigation to Compare page
    const handleCompare = () => {
      const selectedMembers = mockDataTeam.filter(member => checkedItems[member.id]);
      navigate("/compare", {
        state: {
          members: selectedMembers, // Pass the selected members
        },
      });
    };
  
    return (
      <Box m="20px">
        <Header title="Group overview" />
  
        <Grid container spacing={2} sx={{ marginTop: "40px" }}>
          {mockDataTeam.map((member) => (
            <Grid item xs={12} sm={6} md={4} key={member.id}>
              <Accordion
                sx={{
                  backgroundColor: colors.primary[400],
                  borderRadius: "50%", // Make it fully circular
                  width: "200px", // Set equal width and height to make it a circle
                  height: "200px",
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  overflow: "hidden",
                }}
                expanded={expandedId === member.id}
                onChange={() => setExpandedId(expandedId === member.id ? null : member.id)}
              >
                <AccordionSummary
                  expandIcon={<ExpandMoreOutlinedIcon />}
                  sx={{
                    border: "0.1px solid gray",
                    backgroundColor: "#2c2c2c",
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    flexDirection: "column", // To center text vertically
                    borderRadius: "50%", // Also round the summary
                    width: "100%",
                    height: "100%",
                    padding: 0, // Remove padding for proper circular layout
                  }}
                >
                  <Checkbox
                    checked={!!checkedItems[member.id]} // Check if this member is checked
                    onChange={() => handleCheckboxChange(member.id)} // Handle checkbox toggle
                    inputProps={{ 'aria-label': 'Checkbox for ' + member.name }}
                    sx={{
                      color: colors.grey[100], // Default color
                      '&.Mui-checked': {
                        color: colors.blueAccent[500], // Color when checked
                      },
                    }}
                  />
                  <Typography variant="h6" sx={{ color: colors.grey[100], textAlign: "center" }}>
                    {member.name} (ID: {member.ID})
                  </Typography>
                </AccordionSummary>
                <AccordionDetails sx={{ backgroundColor: "#2C2C2C" }}>
                  <Typography sx={{ color: colors.grey[100], textAlign: "center" }}>
                    <strong>Type:</strong> {member.Type}<br />
                    <strong>Status:</strong> {member.Status}<br />
                    <strong>Data:</strong> {member.Data}<br />
                  </Typography>
                  <Box display="flex" justifyContent="center" mt={2}>
                    <Button
                      variant="contained"
                      size="small"
                      sx={{ backgroundColor: colors.blueAccent[500] }}
                      onClick={() => goToPumpPage(member)} // Pass `member` when button is clicked
                    >
                      Go to {member.name}
                    </Button>
                  </Box>
                </AccordionDetails>
              </Accordion>
            </Grid>
          ))}
        </Grid>
        <br />
        <Button
          variant="contained"
          size="large"
          sx={{ backgroundColor: colors.blueAccent[500] }}
          onClick={handleCompare} // Call handleCompare on button click
        >
          Compare
        </Button>
      </Box>
    );
  };
  
  export default Team;
